      "meaning_pt": "CONSTITUIÇÃO DA RAIZ",
      "meaning_ww": "NAATI YEPETACHO WEEWE MICIN",
      "comment_pt": "1. Coifa: revestimento protetor;\n2. Zona lisa: multiplicação e desenvolvimento\ncelular; promove o crescimento da raiz;\n3. Zona pilífera: presença de pelos radiculares\npromovem absorção;\n4. Zona de ramificação: região de surgimento\nde raízes secundárias; suberização de tecido",
      "comment_ww": "1. Yemicin yetihkari: yimicin potucicin poko\ntatihtaxmu;\n2. Roowo yakare yemiten cetike: merpora\ntatihtaxmu yimicin komo eepu pokono;\n3. Yemicn yekeniro: naati micin exitaw\ncewukre kirwanhe romaknasi yimicin roowo\ncheka roro.\n4. Yemicin Yenakan: naati micin tatitaxmu\nyuhnaka rakataw no marha.",
      "created_at": "2024-05-15T00:43:19.463469Z",
