      "meaning_pt": "RAIZ",
      "meaning_ww": "WEEWE WMICIN",
      "comment_pt": "E um órgão vegetativo que fixa a planta no solo, absorve deste, água e sais minerais indispensáveis\npara sua existência.\n\nFUNÇÕES DA RAIZ\n1. Fixação da planta;\n2. Absorção de água e sais minerais;\n3. Reserva Nutritivas;\n4. Condução.",
      "comment_ww": "Yimicin ahnoro naati komo yecehtone roowo poko, ero ketwena marha natikresi naati komo.\n\nAHNORONO NAATI POKONO WEEWE MICIN\n1. Roowo nati yewknaru;\n2. Tuuna nice yemicin yare, kirwanhe natikwa nati Atikwataw;\n3. Natikromwa yathirî;\n4. Nawa kirwanhe.",
